// src/App.js

import React, {Component} from 'react';

class App extends Component {
  render () {
    return (
        <div className="App">
          <header className="App-header">
            <p>
              Quem Aqui joga League of Legends?
            </p>
          </header>
        </div>
    );
  }
}

export default App;
